import React from 'react'
import Sidebar from './sidebar components/Sidebar'
import Name from './Name'
import Order from './sidebar components/Order'
import Favourites from './sidebar components/Favourites'
import Payments from './sidebar components/Payments'
import Address from './sidebar components/Address'

const Profile = () => {
    const selected = window.location.pathname.split('/').slice(-1)
    console.log(selected)
    return (
        <div className='profile-container'>
            <Name />
            <div className='profile-body'>
                <Sidebar />
                <div className='main'>
                    {selected === 'orders' ? (
                        <Order />
                    ) : selected === 'favourites' ? (
                        <Favourites />
                    ) : selected === 'payments' ? (
                        <Payments />
                    ) : selected === 'addresses' ? (
                        <Address />
                    ) : (
                        <></>
                    )}
                </div>
            </div>
        </div>
    )
}

export default Profile
